script: |
  super -f tsv -I q509.sql | sort > q509.out

vector: true

inputs:
  - name: q509.sql
    data: |
      SELECT - - 31 FROM tab1 AS cor0 CROSS JOIN tab2 AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q509.out
    data: |
      31
      31
      31
      31
      31
      31
      31
      31
      31
